import "../../fonts.css";
import "./title.css";
import Typewriter from "typewriter-effect";

const TitlePage = (() => {

    return (
        <div className='title'>

                    <h1 className='header1-pixel pixel'>
                        <Typewriter
                            onInit={(typewriter) => {
                                typewriter.typeString('hi internet! ');
                                typewriter.pauseFor(500);
                                typewriter.typeString("i'm <span style='font-family: england font-size: 8em'>E</span> MILY ");

                                typewriter.start();

                            }}>
                        </Typewriter>
                    </h1>


            {/* <h1 id='emily'>
                <span className='pixel header1-pixel'></span><span className='cursive header1-cursive'>E</span><span className='pixel header1-pixel'>MILY YU</span>
            </h1> */}

            <img src="./memoji.png"></img>

            {/* <div className='two-row'>

                <h3 className='pixel'>
                    a.k.a.
                </h3>
                <h2>
                    <span className='cursive header2-cursive'>S</span>    <span className='pixel header2-pixel'>HAN-YI</span>
                </h2>

            </div> */}

        </div>
    )
})

export default TitlePage;
